COPY faq_i18n (faq_id, culture, question_i18n, answer_i18n) FROM stdin;
1	pt_BR	Como são calculados os Pontos do ranking?	A coluna <b>Pontos</b> exibida no ranking, que pode ser um dos critérios de classificação, \né a soma dos pontos que o jogador acumula durante os eventos e é composta pela seguinte fórmula:<br/><br/>\n\t\t\t\t<b style="font-size: 10pt">(BRA total do evento) / (Buy-in padrão) / (Posição no evento)</b><br/><br/>\n\n                <b>Exemplo:</b><br/>\n\t\t\t\t\n\t\t\t\tUm evento onde buy-in é 10,00 e 8 jogadores participam. Se 3 jogadores dão rebuy e 2 dão add-on, o BRA total do evento será \n\t\t\t\t130,00. Dividindo esse valor pelo buy-in padrão (10,00) obtem-se o total de 13 buy-ins.<br/><br/>\n\t\t\t\tNesse caso, os jogadores receberiam a seguinte pontuação:<br/><br/>\n<table style="margin-top: 5px" cellspacing="1" cellpadding="0" border="0">\n    <tr><th>1</th><th align="right">13,000</td></tr>\n    <tr><th>2</th><th align="right">6,500</td></tr>\n    <tr><th>3</th><th align="right">4,333</td></tr>\n    <tr><th>4</th><th align="right">3,250</td></tr>\n    <tr><th>5</th><th align="right">2,600</td></tr>\n    <tr><th>6</th><th align="right">2,167</td></tr>\n    <tr><th>7</th><th align="right">1,857</td></tr>\n    <tr><th>8</th><th align="right">1,625</td></tr>\n</table>\n    <br/><br/>Todos os jogadores na mesa são pontuados, e quanto melhor a posição, melhor será sua pontuação.
2	pt_BR	Posso mudar meu e-mail após o cadastro?	Sim! Mesmo quando você ainda não é cadastrado no site, seus amigos podem adicioná-lo aos eventos através de seu e-mail.<br/><br/>\nQuando você faz o cadastro utilizando esse mesmo, seu cadastro é automaticamente relacionado aos eventos aos quais você já foi incluído. A partir daí você pode alterar seu e-mail e continuará fazendo parte dos rankings e eventos já inscritos
3	pt_BR	Como faço para apagar um ranking?	\N
1	en_US	Como são calculados os Pontos do ranking?	A coluna <b>Pontos</b> exibida no ranking, e que pode ser um dos critérios de classificação é composta pela seguinte fórmula:<br/><br/>\n\t\t\t\t<b style="font-size: 10pt">(Média*Eventos*10)+(Eventos*10)</b><br/><br/>\n\n                <b>Exemplo:</b><br/>\n<table style="margin-top: 5px" cellspacing="1" cellpadding="0" border="0">\n    <tr><th>(A)</th><th align="right">Total B+R+A:</th><td>40,00</td></tr>\n    <tr><th>(B)</th><th align="right">Total prêmios:</th><td>55,00</td></tr>\n    <tr><th>(C)</th><th align="right">Balanço:</th><td>15,00 (B-A)</td></tr>\n    <tr><th>(D)</th><th align="right">Média:</th><td>1,375 (B/A)</td></tr>\n    <tr><th>(E)</th><th align="right">Eventos:</th><td>3</td></tr>\n    <tr><th>(F)</th><th align="right">Pontos:</th><td>71,25 (D*E*10)+(E*10)</td></tr>\n</table>\n                <br/><br/>Ou seja, quanto maior o a relação Ganhos/Gastos e quanto maior a quantidade de eventos que o jogador participa, maior será sua pontuação.
2	en_US	Posso mudar meu e-mail após o cadastro?	Sim! Mesmo quando você ainda não é cadastrado no site, seus amigos podem adicioná-lo aos eventos através de seu e-mail.<br/><br/>\nQuando você faz o cadastro utilizando esse mesmo, seu cadastro é automaticamente relacionado aos eventos aos quais você já foi incluído. A partir daí você pode alterar seu e-mail e continuará fazendo parte dos rankings e eventos já inscritos
3	en_US	Como faço para apagar um ranking?	\N
\.
