--
-- Name: get_player_average(integer); Type: FUNCTION; Schema: public; Owner: irank
--

CREATE FUNCTION get_player_average(p_people_id integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
  result DECIMAL;
BEGIN
	
    SELECT 
        SUM(event_player.PRIZE/(event_player.BUYIN+event_player.REBUY+event_player.ADDON))
        /
        (SELECT COUNT(1) FROM event_player, event WHERE event_player.PEOPLE_ID = p_people_id AND event.VISIBLE=TRUE AND event.DELETED=FALSE AND event.SAVED_RESULT=TRUE AND event_player.EVENT_ID=event.ID AND event_player.BUYIN > 0) INTO result
    FROM
        event_player, event 
    WHERE 
        event_player.PEOPLE_ID = p_people_id 
        AND event.VISIBLE=TRUE 
        AND event.DELETED=FALSE 
        AND event.SAVED_RESULT=TRUE 
        AND event_player.EVENT_ID=event.ID 
        AND event_player.BUYIN > 0;

   IF result IS NULL THEN
     result := 0;
   END IF;

   RETURN result;
END
$$;


ALTER FUNCTION public.get_player_average(p_people_id integer) OWNER TO irank;

--
-- Name: get_player_balance(integer); Type: FUNCTION; Schema: public; Owner: irank
--

CREATE FUNCTION get_player_balance(p_people_id integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
  result DECIMAL;
BEGIN
	
    SELECT
        get_player_profit(p_people_id)-
        get_player_bra(p_people_id) INTO result;

   IF result IS NULL THEN
     result := 0;
   END IF;

   RETURN result;
END
$$;


