--
-- Name: get_player_bra(integer); Type: FUNCTION; Schema: public; Owner: irank
--

CREATE FUNCTION get_player_bra(p_people_id integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
  result DECIMAL;
BEGIN
	
    SELECT 
        SUM(event_player.BUYIN+event_player.REBUY+event_player.ADDON)+get_player_bra_personal(p_people_id) INTO result
    FROM 
        event_player, event 
    WHERE 
        event_player.PEOPLE_ID = p_people_id
        AND event.VISIBLE=TRUE 
        AND event.DELETED=FALSE 
        AND event.SAVED_RESULT=TRUE 
        AND event_player.EVENT_ID=event.ID;

   IF result IS NULL THEN
     result := 0;
   END IF;

   RETURN result;
END
$$;


ALTER FUNCTION public.get_player_bra(p_people_id integer) OWNER TO irank;

--
-- Name: get_player_bra_personal(integer); Type: FUNCTION; Schema: public; Owner: irank
--

CREATE FUNCTION get_player_bra_personal(p_people_id integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
  result DECIMAL;
BEGIN
	
    SELECT 
        SUM(event_personal.BUYIN+event_personal.REBUY+event_personal.ADDON) INTO result
    FROM 
        event_personal
        INNER JOIN user_site ON event_personal.USER_SITE_ID=user_site.ID
    WHERE 
        user_site.PEOPLE_ID = p_people_id
        AND event_personal.VISIBLE=TRUE 
        AND event_personal.DELETED=FALSE;

   IF result IS NULL THEN
     result := 0;
   END IF;

   RETURN result;
END
$$;


ALTER FUNCTION public.get_player_bra_personal(p_people_id integer) OWNER TO irank;

